            .then(result => this.props.setSwapi(result.data.results));
    }


    return(
        <div>

            <div>
                {
                    this.props.swapiData.map((swapi) => <SwapiItem name={swapi.name} height={swapi.height}
                                                                   mass={swapi.mass}/>)
                }
            </div>
        </div>
    );
}
